import React from "react";
import "../styles/DoctorCard.css";

const DoctorCard = ({ doctor }) => {
  return (
    <div className="doctor-card">
      {/* Left section: Doctor profile */}
      <div className="doctor-profile">
        <img
          src="https://via.placeholder.com/100" // Replace with dynamic doctor image
          alt="Doctor"
          className="doctor-image"
        />
        <div className="doctor-info">
          <h3>{doctor.name}</h3>
          <p>{doctor.specialty}</p>
          <p>{doctor.city}</p>
          <button className="view-profile">Voir profil</button>
        </div>
      </div>

      {/* Right section: Availability slots */}
      <div className="availability">
        <div className="day">
          <h4>lundi</h4>
          {doctor.availability.slice(0, 3).map((slot) => (
            <button key={slot.id} className="slot">
              {slot.time}
            </button>
          ))}
          <button className="more-slots">plus...</button>
        </div>
        <div className="day">
          <h4>mardi</h4>
          {doctor.availability.slice(0, 3).map((slot) => (
            <button key={slot.id} className="slot">
              {slot.time}
            </button>
          ))}
          <button className="more-slots">plus...</button>
        </div>
        <div className="day">
          <h4>mercredi</h4>
          {doctor.availability.slice(0, 3).map((slot) => (
            <button key={slot.id} className="slot">
              {slot.time}
            </button>
          ))}
          <button className="more-slots">plus...</button>
        </div>
      </div>
    </div>
  );
};

export default DoctorCard;
